(function () {
	var global = (1, eval)('this');
	
	var LoadingProgressBarCanvas = function (app) {
		this.app   = app;
		this.game  = this.app.game;
		this.layer = this.game.layerHUD;

		this.setSize();
		this.setGeometry();
		this.createSkeleton();
	};

	var p = LoadingProgressBarCanvas.prototype = {};

	p.createSkeleton = function () {
		this.createGroup();
		this.createBackground();
		this.createThumb();
		this.createAds();
		this.initTween();
	};

	p.setGeometry = function () {
		var x = this.size.width >> 2,
			y = this.size.height  - 100;

		this.geometry = {
			w 		: this.size.width >> 1,
			x  		: x + .5,
			y 		: y + .5,
			padding : [3.5,3.5],
			h 		: 20,
			r 		: 10
		};
	};

	p.initTween = function () {
		this.tween = createjs.Tween.get(this, { override: true});
		this.tween.addEventListener("change", this._handleChange.bind(this));
	};

	p._handleChange = function () {
		var x = this.geometry.x,
			y = this.geometry.y,
			w = this.geometry.w,
			h = this.geometry.h,
			r = this.geometry.r,
			padding = this.geometry.padding;

		if (this.progressGraphics) {
			this.progressGraphics.clear()
				.beginFill('rgb(255,255,255)')
				.drawRoundRect (x + padding[0], y + padding[1], (w - (padding[0] * 2)) * this._progress, h  - (padding[1] * 2), r)
				.endStroke();
		}
	};

	p.createGroup = function () {
		this.group = new createjs.Container();
		this.layer.addChild(this.group);
	};

	p.createAds = function () {
		var y = this.geometry.y,
			w = this.geometry.w,
            base64Logo;

        if (window.Modernizr.isNativeApp) {
			base64Logo = 'assets/images/front/logo4.png';
        } else {
            base64Logo = 'data:image/png;base64,';
        }

		var bitmap = new createjs.Bitmap(base64Logo);
		bitmap.x = w - (280 >> 1);
		bitmap.y = y - 380;
        this.group.addChild(bitmap);
	};

	p.createThumb = function () {
		var x = this.geometry.x,
			y = this.geometry.y,
			w = this.geometry.w,
			h = this.geometry.h,
			r = this.geometry.r;

		var thumb = new createjs.Shape();
		thumb.graphics.setStrokeStyle(1).beginStroke('rgb(255,255,255)').drawRoundRect(x, y, w, h, r).endStroke();
		this.group.addChild(thumb);

		this.progressGraphics = new createjs.Graphics();
		this.progress = new createjs.Shape(this.progressGraphics);
		this.group.addChild(this.progress);
	};

	p.setSize = function () {
		this.size = this.game.getSize();
	};

	p.createBackground = function () {
		var w = this.size.width,
			h = this.size.height;

		var background = new createjs.Shape();
		background.graphics.beginFill('rgb(0,0,0)').drawRect(0, 0, w, h);
		this.group.addChild(background);
	};

	p._progress = 0;

	p.setProgress = function (progress) {
		if (this.destroyed) return;

		var that = this;
		if (that._prePogress >= progress) return;
		that._prePogress = progress;

		this.tween.to({ _progress : progress }, 350 ).call(function(){
			if (that._progress == 1) {
				that.finish();
			}
		}).setPaused(false);
	};

	p.getProgress = function () {
		return this._progress;
	};

	p.isFinished = false;

	p.finish = function () {
		if (this.destroyed) return;
		typeof this.onFinish === 'function' && this.onFinish();
		this.isFinished = true;
	};

	p.destroyed = false;

	p.destroy = function () {
		if (this.destroyed) return;

		this.destroyed = true;
		this.group.removeAllChildren();
		this.layer.removeChild(this.group);

		delete this.group;
		delete this.progress;
	};

	global.LoadingProgressBarCanvas = LoadingProgressBarCanvas;
}());